    'content': React.createElement("article", { dangerouslySetInnerHTML: {
            __html: '<h1>入门</h1>\n<p>让我们创建并运行我们的第一个Rocket应用程序。我们将确保我们具有Rust的兼容版本，创建一个依赖于Rocket的新Cargo项目，然后运行该应用程序。</p>\n<h2 id="安装rust">安装Rust<a class="anchor" href="Getting-Started/Installing-Rust.html#安装rust">§</a></h2>\n<p>Rocket充分利用了Rust的语法扩展和其他高级的，不稳定的功能。因此，我们需要使用 <strong>nightly</strong> 版本的Rust。如果您已经可以使用最新的Rust <strong>nightly</strong> 安装，请随时跳到下一部分。</p>\n<p>要安装 <strong>nightly</strong> 版本的Rust，建议使用<code>rustup</code>。按照<a href="https://rustup.rs/">网站</a>上的说明进行安装<code>rustup</code>。安装<code>rustup</code>后，通过运行以下命令将Rust <strong>nightly</strong> 配置为默认的工具链：</p>\n<pre class="language-shell"><code class="language-shell">rustup default nightly\n</code></pre>\n<p>如果愿意，在以下部分中设置项目目录后，您可以通过在目录中运行以下命令，使用目录覆盖来仅对Rocket项目使用 <strong>nightly</strong> 版本：</p>\n<pre class="language-shell"><code class="language-shell">rustup override <span class="token builtin class-name">set</span> nightly\n</code></pre>\n<h3 id="警告rocket-需要使用最新的-nightly-版本-rust">警告：Rocket 需要使用最新的 <em>nightly</em> 版本 Rust。<a class="anchor" href="Getting-Started/Installing-Rust.html#警告rocket-需要使用最新的-nightly-版本-rust">§</a></h3>\n<p>如果您的Rocket应用程序突然停止构建，请通过以下方式更新您的工具链和依赖项，以确保您使用的是 Rust <strong>Nightly</strong> 和 Rocket 的最新版本：</p>\n<p><code>rustup update &amp;&amp; cargo update</code></p>'
        } }),
